// Function to create data
function createData(crypto) {
  return {
    name: (
      <div className="name">
        <img src={crypto.img_link} alt={crypto.name} className="image" />
        <div>
          <div>{crypto.name}</div>
          <div className="symbol">{crypto.symbol}</div>
        </div>
      </div>
    ),
    symbol: crypto.symbol,
    price: crypto.price,
    change: crypto.change,
    marketcap: crypto.marketcap,
    watch: crypto.watch,
  };
}

// Create rows dynamically
const rows = cryptos.map((crypto) => createData(crypto));

